import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Items from "./components/Items";

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      items: [
        {
          id: 1,
          title: 'Труба 1',
          img: 'truba1.jpg',
          desc: 'Truba nomer 1.',
          category: 'Trub',
          price: '100'
        },
        {
          id: 2,
          title: 'Труба 2',
          img: 'truba2.jpg',
          desc: 'Truba nomer 2.',
          category: 'Trub',
          price: '200'
        },
        {
          id: 3,
          title: 'Труба 3',
          img: 'truba3.jpg',
          desc: 'Truba nomer 3.',
          category: 'Trub',
          price: '150'
        }
      ]
    }
  }
  render() {
    return (
      <div className="wrapper">
        <Header />
        <Items items={this.state.items}></Items>
        <Footer />
      </div>
    );
  }
}

export default App;
